pragma solidity ^0.4.23;

import "./interfaces/IParameterSource.sol";
import "zeppelin-solidity/contracts/ownership/Ownable.sol";


// TODO: Consider multiple ownership or hertiable
contract Parameters is Ownable, IParameterSource { 

    mapping(string => mapping(string => address)) private addresses;
    mapping(string => mapping(string => uint256)) private uints;
    mapping(string => mapping(string => string)) private strings;

    function getAddress(string _class, string _name) public view returns (address) { 
        return addresses[_class][_name];
    } 

    function getUInt(string _class, string _name) public view returns (uint256) { 
        return uints[_class][_name];
    }

    function getString(string _class, string _name) public view returns (string) { 
        return strings[_class][_name];
    }

    function setAddress(string _class, string _name, address _value) public onlyOwner returns (bool) { 
        addresses[_class][_name] = _value;
        return true;
    }

    function setUInt(string _class, string _name, uint256 _value) public onlyOwner returns (bool) { 
        uints[_class][_name] = _value;
        return true;
    }

    function setString(string _class, string _name, string _value) public onlyOwner returns (bool) { 
        strings[_class][_name] = _value;
        return true;
    }
}
